import React, { Component } from 'react'
import { Router, Route } from 'react-router'

class page extends Component {
    render() {
        return (
            <div className="pageContainer">
                <Router>
                    <Route exact path="/" component={Home}/>
                </Router>
            </div>
        )
    }
}

export default page;
